    render(){
var  projectList=[];
const listItems='';
        fetch('http://localhost:3001/get-project-list').then((res) => { 
            for (let index = 0; index < res.json().length; index++) {
                projectList.push(res.json[index]);
                console.log(projectList);
            }

        });
        return (
                <div className="container">
                        <div className="row">
